import React, { Component } from 'react';
import { Form, Button } from 'semantic-ui-react';

class CampaignNew extends Component {
    render() {
        return (
            <div>
                <h1>New Campaign</h1>
                <Form>
                    <Form.Field>
                        <label>Minimum Contribution</label>
                        <input />
                    </Form.Field>
                    <Button primary>Create!</Button>
                </Form>
            </div>
        )
    }
}

export default CampaignNew;
